import {YMaps, Map} from 'react-yandex-maps';

const YandexMaps = () => (
    <YMaps>
        <div>
            <Map

                defaultState={{center: [55.75, 37.57]}}
                zoom={9}
            />
        </div>
    </YMaps>
);

export default YandexMaps;
